import './App.css';
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import {
  HomeScreen, 
  AboutScreen, 
  ArticleScreen, 
  ContactScreen,
  PageNotFoundScreen
} 
from './screens/ScreenExports';
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<HomeScreen/>} />
        <Route path="about" element={<AboutScreen />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
